import Link from 'next/link';
import './index.scss';




export default function Index() {
  return (

      <Layout>


        <h1>Welcome !</h1>
<style jsx>{`
  h1,
  {
    font-family: 'Arial';
    color: #46634e;
  }

  body {
    padding: 20px 20px 60px;
    margin: 0;
    bacground-image: url('../public/images/next.jpg')
  }

`}</style>
      </Layout>





  );


}
































